import React, { useState, useEffect, useContext } from 'react'
import { NavLink, useHistory } from "react-router-dom";
import Stripe from "react-stripe-checkout";

import { UserContext } from "../App"

const Rentcarcart = () => {

    const { state, dispatch } = useContext(UserContext)

    const [cartUser, setCartUser] = useState([]);
    const [items, setItems] = useState([]);
    let itemsPrice, idOfRentedCar, reqDays;

    const getCartData = async () => {
        try {
            const res = await fetch('/getRentCartData', {
                method: 'GET',
            });

            const data = await res.json();
            setCartUser(data.userById)
            setItems(data.cartItems)


            if (!res.status === 200) {
                const error = new Error(res.error);
                throw error;
            }

        } catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        getCartData();
    }, [])


    const handleDeleteCartItem = async (itemsId) => {
        try {
            const res = await fetch(`/deleteCartItem/${itemsId}`, {
                method: 'DELETE',
            });

            if (res.status === 200) {
                // Item deleted successfully, update the cart data
                getCartData();
                setItems(items.filter(item => item._id !== itemsId));
            } else {
                const error = new Error(res.error);
                throw error;
            }
        } catch (error) {
            console.log(error);
        }
    };

    items.forEach(items => {
        itemsPrice = items.totalbill;
        idOfRentedCar = items.rentcarid;
        reqDays = items.requireddays;
    })

    const handlePayMethod = (itemsPrice, token) => {
        return fetch("/stripeRentPay", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                token: token.id,
                amount: itemsPrice,
                idRentedCar: idOfRentedCar,
                daysRequired: reqDays
            })
        })

    }

    const tokenHandler = (token) => {
        handlePayMethod(itemsPrice, token);
        updateDataBase();
    }


    const updateDataBase = () => {
        return fetch("/updateRentDataBase", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                items
            })
        })
    }




    const Loginbutton = () => {

        if (state) {
            return <div>
                <button ><NavLink className="btn" to="/signout">logout</NavLink></button>
            </div>
        }
        else {
            return <div>
                <button ><NavLink className="btn" to="/signin">login</NavLink></button>

            </div>
        }
    }



    return (
        <>
            <header className="header">
                <div id="menu-btn" className="fas fa-bars"></div>
                <NavLink className="logo" to="/"> <span>Car</span>Rent </NavLink>

                <nav className="navbar">
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/rentcar">Rent A Car</NavLink>
                </nav>

                <div id="login-btn">
                    <Loginbutton />
                </div>
            </header>

            <div className='salecartMaindiv'>
                <div style={{
                    marginTop: "150px",
                }}>
                    {items.map((items) =>
                        <div className="salecartLidiv" key={items._id}>
                            <ul>
                                <li style={{ wordSpacing: "10px" }}>
                                    Brand: {items.brand} ---
                                    Model: {items.model} ---
                                    Days: {items.requireddays} ---
                                    RentPerDay: {items.rentperday}DA ---
                                    TotalBill: {items.totalbill}DA
                                    <button className="btn" onClick={() => handleDeleteCartItem(items._id)}><i className="fa fa-trash"></i></button>
                                </li>
                            </ul>

                        </div>

                    )}
                    <div style={{ padding: "30px", textAlign: "center" }}>
                        <h2>Pay Through Credit / Debit Card</h2><br />
                        <Stripe
                            stripeKey="pk_test_51Jyb5UBvc4Qazj8jy6qimLop4epxe5jziUD3ixj5ISycjjD6yYVGZhk688Pz9Lna32VTHbSHxRwkrvNNnnnr96P000M68u5jcd"
                            token={tokenHandler}
                        />
                    </div>

                </div>
            </div>
            <footer className="footer" id="footer" style={{ position: "fixed", bottom: "0", left: "0", right: "0" }}>


                <div className="box-container">

                    <div className="box">
                        <h3>our branch</h3>
                        <a href="#"> <i className="fas fa-map-marker-alt"></i> Algeria, Blida, Ouled Yaich </a>

                    </div>

                    <div className="box">
                        <h3>quick links</h3>
                        <a href="#"> <i className="fas fa-arrow-right"></i> home </a>
                        <a href="rentcar"> <i className="fas fa-arrow-right"></i> vehicles </a>
                        <a href="#services"> <i className="fas fa-arrow-right"></i> reviews </a>
                        <a href="#contact"> <i className="fas fa-arrow-right"></i> contact </a>
                    </div>

                    <div className="box">
                        <h3>contact info</h3>
                        <a href="#"> <i className="fas fa-phone"></i> +123-456-7890 </a>
                        <a href="#"> <i className="fas fa-phone"></i> +111-222-3333 </a>
                        <a href="#"> <i className="fas fa-envelope"></i> carrent@gmail.com </a>
                    </div>

                    <div className="box">
                        <h3>contact info</h3>
                        <a href="#"> <i className="fab fa-facebook-f"></i> facebook : carrentdz </a>
                        <a href="#"> <i className="fab fa-whatsapp"></i> whatsapp : +123-456-789</a>
                        <a href="#"> <i className="fab fa-instagram"></i> instagram : carrentdz</a>
                    </div>

                </div>


                <div className="credit">  Copyright &copy; {new Date().getFullYear()} Akrily. All rights reserved </div>


            </footer>
        </>
    )
}

export default Rentcarcart
